export function listSeedTowns(pref: string, city: string): string[] {
  return (NTA_TOWN_SEEDS[pref]?.[city] ?? []).slice();
}

export function isSeedTown(pref: string, city: string, town: string): boolean {
  const arr = NTA_TOWN_SEEDS[pref]?.[city] ?? [];
  return arr.includes(town);
}
